 #рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃА рЃерЃћрЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЌ рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃА рЃЌрЃБрЃљрЃарЃљ рЃњрЃЮрЃљрЃерЃў, рЃЌрЃБ рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃА рЃерЃћрЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЌ рЃЮрЃЏрЃћрЃџ рЃ»рЃњрЃБрЃцрЃерЃўрЃљ, рЃЌрЃБ рЃърЃљрЃАрЃБрЃ«рЃў рЃўрЃЦрЃюрЃћрЃЉрЃљ рЃ»рЃњрЃБрЃцрЃў13 рЃерЃћрЃћрЃЎрЃўрЃЌрЃћрЃЌ рЃарЃЮрЃЏ рЃљрЃарЃўрЃА рЃЌрЃБ рЃљрЃарЃљ рЃњрЃљрЃЉрЃарЃўрЃћрЃџрЃў рЃЏрЃўрЃАрЃў рЃЏрЃћрЃюрЃбрЃЮрЃарЃў, рЃЌрЃБ рЃърЃљрЃАрЃБрЃ«рЃў рЃўрЃЦрЃюрЃћрЃЉрЃљ рЃЎрЃў рЃБрЃЌрЃ«рЃљрЃарЃўрЃЌ рЃарЃЮрЃЏ рЃЌрЃЦрЃЋрЃћрЃюрЃф рЃљрЃЦ рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃЌ рЃЊрЃљ рЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџрЃљрЃЊ рЃњрЃљрЃЉрЃарЃўрЃћрЃџрЃўрЃљ рЃЮрЃарЃўрЃЋрЃћрЃА рЃЏрЃћрЃюрЃбрЃЮрЃарЃў, рЃЌрЃБ рЃърЃљрЃАрЃБрЃ«рЃў рЃљрЃарЃўрЃЦрЃюрЃћрЃЉрЃљ рЃњрЃљрЃЉрЃарЃўрЃћрЃџрЃў рЃДрЃЋрЃћрЃџрЃљ рЃАрЃ«рЃЋрЃљ рЃерЃћрЃЏрЃЌрЃ«рЃЋрЃћрЃЋрЃљрЃерЃў рЃЊрЃљрЃБрЃЉрЃћрЃГрЃЊрЃћрЃЌ рЃарЃЮрЃЏ рЃўрЃА рЃбрЃДрЃБрЃўрЃА рЃЊрЃљ рЃљрЃарЃљрЃарЃўрЃА рЃАрЃўрЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџрЃћрЃерЃў рЃ»рЃњрЃБрЃц13-рЃерЃў ­ЪўЅ


ansver = input("рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉ рЃЌрЃБ рЃљрЃарЃљ рЃњрЃЮрЃљ-рЃерЃў")
if ansver =="рЃЎрЃў":
    groop = input("рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉ рЃЌрЃБ рЃљрЃарЃљ рЃЏрЃћ-13 рЃ»рЃњрЃцрЃерЃў")
    if groop == "рЃЎрЃў":
        techer = input("рЃљрЃарЃўрЃА рЃЌрЃБ рЃљрЃарЃљ рЃњрЃљрЃЉрЃарЃўрЃћрЃџрЃў рЃерЃћрЃюрЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў ")
        if techer == "рЃЎрЃў":
            print("рЃерЃћрЃю рЃЏрЃљрЃарЃбрЃџрЃљрЃф рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉ рЃњрЃЮрЃљрЃерЃў")
        else:
            print("рЃљрЃарЃљ рЃерЃћрЃю рЃўрЃбрЃДрЃБрЃћрЃЉрЃў")